namespace RonSijm.FluidHumidifier.Factories.DMS;

public class EndpointFactory(string resourceName = null, Action<Humidifier.DMS.Endpoint> factoryAction = null) : ResourceFactory<Humidifier.DMS.Endpoint>(resourceName)
{

    internal InnerEndpointSybaseSettingsFactory SybaseSettingsFactory { get; set; }

    internal InnerEndpointRedisSettingsFactory RedisSettingsFactory { get; set; }

    internal InnerEndpointOracleSettingsFactory OracleSettingsFactory { get; set; }

    internal InnerEndpointKafkaSettingsFactory KafkaSettingsFactory { get; set; }

    internal InnerEndpointMySqlSettingsFactory MySqlSettingsFactory { get; set; }

    internal InnerEndpointS3SettingsFactory S3SettingsFactory { get; set; }

    internal InnerEndpointKinesisSettingsFactory KinesisSettingsFactory { get; set; }

    internal InnerEndpointRedshiftSettingsFactory RedshiftSettingsFactory { get; set; }

    internal InnerEndpointMongoDbSettingsFactory MongoDbSettingsFactory { get; set; }

    internal InnerEndpointIbmDb2SettingsFactory IbmDb2SettingsFactory { get; set; }

    internal InnerEndpointNeptuneSettingsFactory NeptuneSettingsFactory { get; set; }

    internal InnerEndpointElasticsearchSettingsFactory ElasticsearchSettingsFactory { get; set; }

    internal InnerEndpointDocDbSettingsFactory DocDbSettingsFactory { get; set; }

    internal InnerEndpointDynamoDbSettingsFactory DynamoDbSettingsFactory { get; set; }

    internal InnerEndpointMicrosoftSqlServerSettingsFactory MicrosoftSqlServerSettingsFactory { get; set; }

    internal InnerEndpointGcpMySQLSettingsFactory GcpMySQLSettingsFactory { get; set; }

    internal InnerEndpointPostgreSqlSettingsFactory PostgreSqlSettingsFactory { get; set; }

    protected override Humidifier.DMS.Endpoint Create()
    {
        var endpointResult = CreateEndpoint();
        factoryAction?.Invoke(endpointResult);

        return endpointResult;
    }

    private Humidifier.DMS.Endpoint CreateEndpoint()
    {
        var endpointResult = new Humidifier.DMS.Endpoint
        {
            GivenName = InputResourceName,
        };

        return endpointResult;
    }
    public override void CreateChildren(Humidifier.DMS.Endpoint result)
    {
        base.CreateChildren(result);

        result.SybaseSettings ??= SybaseSettingsFactory?.Build();
        result.RedisSettings ??= RedisSettingsFactory?.Build();
        result.OracleSettings ??= OracleSettingsFactory?.Build();
        result.KafkaSettings ??= KafkaSettingsFactory?.Build();
        result.MySqlSettings ??= MySqlSettingsFactory?.Build();
        result.S3Settings ??= S3SettingsFactory?.Build();
        result.KinesisSettings ??= KinesisSettingsFactory?.Build();
        result.RedshiftSettings ??= RedshiftSettingsFactory?.Build();
        result.MongoDbSettings ??= MongoDbSettingsFactory?.Build();
        result.IbmDb2Settings ??= IbmDb2SettingsFactory?.Build();
        result.NeptuneSettings ??= NeptuneSettingsFactory?.Build();
        result.ElasticsearchSettings ??= ElasticsearchSettingsFactory?.Build();
        result.DocDbSettings ??= DocDbSettingsFactory?.Build();
        result.DynamoDbSettings ??= DynamoDbSettingsFactory?.Build();
        result.MicrosoftSqlServerSettings ??= MicrosoftSqlServerSettingsFactory?.Build();
        result.GcpMySQLSettings ??= GcpMySQLSettingsFactory?.Build();
        result.PostgreSqlSettings ??= PostgreSqlSettingsFactory?.Build();
    }

} // End Of Class

